import React from "react";
import classes from "./NavBar.module.css";

const NavBar = () => {
	return (
		<React.Fragment>
			<div className="`${classes.navDiv}">
				<nav>
					<ul>
						<li>aaaa</li>
						<li>bbbb</li>
						<li>cccc</li>
					</ul>
				</nav>
			</div>
		</React.Fragment>
	);
};

export default NavBar;
